export default function TeacherManagement() {
  return (
    <>
      <table>
        <tr>
          <th>ID</th>
          <th>Teacher Name</th>
          <th>Teacher Email</th>
          <th>Teacher Subject</th>
        </tr>
      </table>
    </>
  );
}
